import React from "react";
import searchIconBlack from '../assets/search-icon-black.png';
import searchIconWhite from '../assets/search-icon-white.png'

function Navbar() {
    return (
        <div className="w-2/3 flex flex-row gap-5 items-center justify-around mx-auto">
            <a className="justify-self-start hover:underline" href="#">About</a>
            <form id="main-search-bar" className="w-96 flex flex-row">
                <input className="w-2/3 p-2 rounded-l-full" type="text" placeholder="Search for a product..."></input>
                <button className="w-24 flex items-center justify-center rounded-r-full bg-blue-500 hover:bg-blue-400 transition-all" type="submit">
                    <div className="w-8 relative">
                        <img src={searchIconWhite} alt="Search Icon"></img>
                    </div>
                </button>
            </form>
            <a className="hover:underline" href="#">Basket</a>
            <a className="hover:underline" href="#">Profile</a>
        </div>
    )
}

export default Navbar;
